import React, { useState, useCallback, useEffect } from 'react';
import {
  Box,
  Typography,
  Alert,
  Chip,
  Grid,
  Paper,
  Card,
  IconButton
} from '@mui/material';
import { 
  CloudUpload, 
  CheckCircle, 
  Error, 
  BugReport,
  Psychology,
  Analytics,
  Security,
  ExpandMore,
  ExpandLess,
  TrendingUp,
  Warning,
  Shield,
  Speed,
  AutoFixHigh,
  SmartToy,
  DataUsage,
  NetworkCheck,
  Assessment
} from '@mui/icons-material';
import { useDropzone } from 'react-dropzone';
import apiClient from '../config/api';

interface UploadResult {
  message: string;
  logs_processed: number;
  anomalies_detected: number;
  candidate_rules_generated: number;
  anomalies: any[];
}

interface MLProcessingStep {
  id: string;
  label: string;
  description: string;
  icon: React.ReactNode;
  completed: boolean;
  active: boolean;
  duration?: number;
}

const LogUpload: React.FC = () => {
  const [uploading, setUploading] = useState(false);
  const [uploadResult, setUploadResult] = useState<UploadResult | null>(null);
  const [error, setError] = useState<string | null>(null);
  const [processingSteps, setProcessingSteps] = useState<MLProcessingStep[]>([]);
  const [activeStep, setActiveStep] = useState(0);
  const [showMLInsights, setShowMLInsights] = useState(false);
  const [expandedAnomalies, setExpandedAnomalies] = useState<Set<number>>(new Set());

  const initializeMLSteps = useCallback(() => {
    const steps: MLProcessingStep[] = [
      {
        id: 'upload',
        label: 'Getting Files',
        description: 'Uploading your log files',
        icon: <CloudUpload />,
        completed: false,
        active: false
      },
      {
        id: 'preprocessing',
        label: 'Organizing Data',
        description: 'Making sense of your logs',
        icon: <DataUsage />,
        completed: false,
        active: false,
        duration: 2000
      },
      {
        id: 'ml_analysis',
        label: 'AI Detective Work',
        description: 'Our AI is looking for weird stuff',
        icon: <SmartToy />,
        completed: false,
        active: false,
        duration: 4000
      },
      {
        id: 'pattern_recognition',
        label: 'Finding Patterns',
        description: 'Spotting suspicious activities',
        icon: <Psychology />,
        completed: false,
        active: false,
        duration: 2500
      },
      {
        id: 'rule_generation',
        label: 'Making Rules',
        description: 'Creating security rules from findings',
        icon: <AutoFixHigh />,
        completed: false,
        active: false,
