            </Grid>
          </Box>

          {/* Hand-Drawn Anomalies Section */}
          {uploadResult.anomalies && uploadResult.anomalies.length > 0 && (
            <Box sx={{ mt: 6 }}>
              <Typography 
                variant="h3" 
                sx={{ 
                  textAlign: 'center',
                  mb: 4,
                  color: '#2d2d2d',
                  transform: 'rotate(-0.5deg)',
                  position: 'relative',
                  '&::before': {
                    content: '"ðŸ”"',
                    position: 'absolute',
                    left: -50,
                    top: 0,
                    transform: 'rotate(20deg)',
                  }
                }}
              >
                What We Found!
              </Typography>

              <Grid container spacing={3}>
                {uploadResult.anomalies.map((anomaly, index) => (
                  <Grid item xs={12} md={6} key={index}>
                    <Card 
                      sx={{ 
                        p: 3,
                        transform: `rotate(${index % 2 === 0 ? '-1deg' : '1deg'})`,
                        backgroundColor: getSeverityColor(anomaly.severity_score) === 'error' ? '#ffebee' : '#fff9c4',
                        position: 'relative',
                        '&:hover': {
                          transform: `rotate(${index % 2 === 0 ? '1deg' : '-1deg'}) scale(1.02)`,
                        },
                        // Severity indicator
                        '&::before': {
                          content: '""',
                          position: 'absolute',
                          top: 15,
                          right: 15,
                          width: 15,
                          height: 15,
                          backgroundColor: getSeverityColor(anomaly.severity_score) === 'error' ? '#ff4d4d' : '#ff9800',
                          borderRadius: '50%',
                          border: '2px solid #2d2d2d',
                          zIndex: 1,
                        }
                      }}
                    >
                      <Box display="flex" alignItems="center" gap={2} mb={2}>
                        {/* Wobbly Icon */}
                        <Box
                          sx={{
                            width: 50,
                            height: 50,
                            backgroundColor: getSeverityColor(anomaly.severity_score) === 'error' ? '#ff4d4d' : '#ff9800',
                            borderRadius: '255px 15px 225px 15px / 15px 225px 15px 255px',
                            border: '3px solid #2d2d2d',
                            display: 'flex',
                            alignItems: 'center',
                            justifyContent: 'center',
                            boxShadow: '2px 2px 0px 0px #2d2d2d',
                          }}
                        >
                          {getMLInsightIcon(anomaly.anomaly_type)}
                        </Box>

                        <Box flex={1}>
                          <Typography 
                            variant="h6" 
                            sx={{ 
                              color: '#2d2d2d',
                              fontFamily: '"Kalam", cursive',
                              fontWeight: 700,
                              mb: 0.5,
                            }}
                          >
                            {anomaly.anomaly_type.replace('_', ' ')} Alert!
                          </Typography>
                          <Chip
                            label={`Severity: ${(anomaly.severity_score * 100).toFixed(0)}%`}
                            color={getSeverityColor(anomaly.severity_score)}
                            size="small"
                            sx={{
                              borderRadius: '255px 15px 225px 15px / 15px 225px 15px 255px',
                              fontFamily: '"Patrick Hand", cursive',
                            }}
                          />
                        </Box>

                        <IconButton
                          onClick={() => toggleAnomalyExpansion(index)}
                          sx={{
                            color: '#2d2d2d',
                            '&:hover': {
                              backgroundColor: 'rgba(255, 77, 77, 0.1)',
                              transform: 'rotate(10deg)',
                            }
                          }}
                        >
                          {expandedAnomalies.has(index) ? <ExpandLess /> : <ExpandMore />}
                        </IconButton>
                      </Box>

                      <Typography 
                        variant="body1" 
                        sx={{ 
                          color: '#2d2d2d',
                          mb: 2,
                          lineHeight: 1.6,
                        }}
                      >
                        {getAnomalyTypeDescription(anomaly.anomaly_type)}
                      </Typography>

                      {expandedAnomalies.has(index) && (
                        <Box 
                          sx={{ 
                            mt: 2, 
                            p: 2, 
                            backgroundColor: 'rgba(45, 45, 45, 0.05)',
                            borderRadius: '255px 15px 225px 15px / 15px 225px 15px 255px',
                            border: '2px dashed #2d2d2d',
                          }}
                        >
                          <Typography 
                            variant="subtitle2" 
                            sx={{ 
                              color: '#2d2d2d',
                              fontFamily: '"Kalam", cursive',
                              fontWeight: 700,
                              mb: 1,
                            }}
                          >
                            Technical Details:
                          </Typography>
                          <Typography 
                            variant="body2" 
                            sx={{ 
                              fontFamily: '"Courier New", monospace',
                              backgroundColor: '#2d2d2d',
                              color: '#fff9c4',
                              p: 1,
                              borderRadius: '255px 15px 225px 15px / 15px 225px 15px 255px',
                              fontSize: '0.85rem',
                            }}
                          >
                            {JSON.stringify(anomaly, null, 2)}
                          </Typography>
                        </Box>
                      )}
                    </Card>
                  </Grid>
                ))}
              </Grid>
            </Box>
          )}
        </Box>
      )}
    </Box>
  );
};

export default LogUpload;
